import React from 'react';
import './Home.css';
import { Image, Button } from 'react-bootstrap';

const Home = () => {
  return (
    <div className="container-fluid p-0">
      <div className="row m-0 vh-100 align-items-center justify-content-center text-center">
        <div className="col-12">
          <h1 className="text-light mb-4">Welcome to MyApp</h1>
          <p className="text-light mb-4">
            This is the home page of your application. Feel free to explore the features available.
          </p>
          <Image
            src='https://images.pexels.com/photos/4406689/pexels-photo-4406689.jpeg?auto=compress&cs=tinysrgb&w=600'
            alt="Welcome Banner"
            className="img-fluid mb-4"
            style={{ maxHeight: '300px', width: 'auto' }}
          />
          <Button className='bg-primary'>Signup</Button>
        </div>
      </div>
    </div>
  );
};

export default Home;
